int equalGrid(int grid[MAX_Y][MAX_X], int newGrid[MAX_Y][MAX_X]);
int countNeighbours(int grid[MAX_Y][MAX_X], int x, int y);
int isGridDead(int grid[MAX_Y][MAX_X]);
void gameLoop(int grid[MAX_Y][MAX_X]);
void copyGrid(int grid[MAX_Y][MAX_X], int newGrid[MAX_Y][MAX_X]);
void setSpeed(char numKey, int *speed);

int main()
{
    initscr(); // Инициализация ncurses
    int grid[MAX_Y][MAX_X];

    start_color();
    init_pair(1, COLOR_RED, COLOR_BLACK);
    init_pair(2, COLOR_GREEN, COLOR_BLACK);

    greetings();

    FILE *file;

    // Проверяем, был ли stdin перенаправлен или это терминал
    if (isatty(fileno(stdin)))
    {
        // Если stdin — терминал, запрашиваем у пользователя файл
        file = openFile();
    }
    else
    {
        // Если stdin перенаправлен, читаем из него
        file = stdin;
    }

    if (file == NULL)
    {
        endwin();
        exit(EXIT_FAILURE); // Завершение программы при ошибке открытия файла
    }
    
    noecho();

    recordFromFile(grid, file);

    if (file != stdin)
        fclose(file);

    nodelay(stdscr, TRUE); // Устанавливаем неблокирующий режим для getch()

    gameLoop(grid);

    endwin();
    return 0;
}

void greetings()
{
    char *title = "Game of Life";
    char *title2 = "Press any key to continue";

    int length = strlen(title);
    int xN = (COLS - length) / 2;
    int yN = LINES / 2;

    attron(COLOR_PAIR(2));
    for (int i = 0; i <= length; i++)
    {
        mvprintw(yN, xN, "%.*s", i, title); // Печатаем по одному символу
        refresh();                          // Обновляем экран
        usleep(100000);                     // Пауза 100 мс
    }
    attroff(COLOR_PAIR(2));

    curs_set(FALSE); // Скрыть курсор

    attron(A_BLINK);
    mvprintw(LINES / 2 + 2, (COLS - strlen(title2)) / 2, "%s", title2);
    refresh();
    getch(); // Ожидаем нажатие любой клавиши
    clear();
    attroff(A_BLINK);
}

FILE *openFile()
{
    int numFiles;
    char *title3 = "Enter file number (1-5) for starting positions:";
    curs_set(TRUE); // Показать курсор
    attron(COLOR_PAIR(2));
    mvprintw(LINES / 2, (COLS - strlen(title3)) / 2, "%s", title3);
    scanw("%d", &numFiles); // Ожидание ввода пользователя
    curs_set(FALSE);        // Скрыть курсор
    attroff(COLOR_PAIR(2));

    char masTxt[6]; // Увеличиваем размер массива
    snprintf(masTxt, sizeof(masTxt), "%d.txt", numFiles);

    FILE *file = fopen(masTxt, "r");

    if (file == NULL)
    {
        char *titleEr = "Error, the file could not be opened.";
        char *titleEr2 = "Press enter to exit";
        attron(COLOR_PAIR(1));
        mvprintw(LINES / 2 + 2, (COLS - strlen(titleEr)) / 2, "%s", titleEr);
        mvprintw(LINES / 2 + 3, (COLS - strlen(titleEr2)) / 2, "%s", titleEr2);
        refresh();
        attroff(COLOR_PAIR(1));
        getch();
    }

    return file;
}

void recordFromFile(int grid[MAX_Y][MAX_X], FILE *file)
{
    char s;
    for (int y = 0; y < MAX_Y; y++)
    {
        for (int x = 0; x < MAX_X; x++)
        {
            do
            {
                fscanf(file, "%c", &s); // Считываем символы
            } while (s == '\n' || s == ' '); // Игнорируем символы новой строки и пробелы
            if (s == '1')
            {
                grid[y][x] = 1;
            }
            else
            {
                grid[y][x] = 0;
            }
        }
    }
}

void displayGrid(int grid[MAX_Y][MAX_X])
{
    attron(COLOR_PAIR(2));
    clear();
    for (int y = 0; y < MAX_Y; y++)
    {
        for (int x = 0; x < MAX_X; x++)
        {
            if (grid[y][x] == 1)
            {
                mvprintw(y, x, "O"); // Живая клетка
            }
            else
            {
                mvprintw(y, x, " "); // Мёртвая клетка
            }
        }
    }
    attroff(COLOR_PAIR(2));
    refresh();
}

int updateGrid(int grid[MAX_Y][MAX_X])
{
    int flag = 0;
    int countNeighbour;
    int newGrid[MAX_Y][MAX_X];

    for (int y = 0; y < MAX_Y; y++)
    {
        for (int x = 0; x < MAX_X; x++)
        {
            countNeighbour = countNeighbours(grid, x, y);
            if ((grid[y][x] == 1) && (countNeighbour >= 2) && (countNeighbour <= 3))
            {
                newGrid[y][x] = 1;
            }
            else if ((countNeighbour == 3) && (grid[y][x] == 0))
            {
                newGrid[y][x] = 1;
            }
            else
            {
                newGrid[y][x] = 0;
            }
        }
    }

    if (equalGrid(grid, newGrid))
    {
        flag = 1;
    }
    copyGrid(grid, newGrid);
    return flag;
}

int equalGrid(int grid[MAX_Y][MAX_X], int newGrid[MAX_Y][MAX_X])
{
    int flag = 1;
    for (int y = 0; y < MAX_Y; y++)
    {
        for (int x = 0; x < MAX_X; x++)
        {
            if (grid[y][x] != newGrid[y][x])
            {
                flag = 0;
            }
        }
    }
    return flag;
}

int countNeighbours(int grid[MAX_Y][MAX_X], int x, int y)
{
    int count = 0;

    for (int i = -1; i <= 1; i++)
    {
        for (int j = -1; j <= 1; j++)
        {
            if ((i == 0) && (j == 0))
                continue; // Пропускаем саму клетку

            int neighbourX = (x + i + MAX_X) % MAX_X;
            int neighbourY = (y + j + MAX_Y) % MAX_Y;

            count += grid[neighbourY][neighbourX];
        }
    }

    return count;
}

int isGridDead(int grid[MAX_Y][MAX_X])
{
    int flag = 1;
    for (int y = 0; y < MAX_Y; y++)
    {
        for (int x = 0; x < MAX_X; x++)
        {
            if (grid[y][x] == 1)
            {
                flag = 0; // Есть живая клетка
            }
        }
    }
    if (flag == 1)
    {
        clear();
        const char *titleDied = "All cells are dead. Game over.";
        attron(COLOR_PAIR(1));
        mvprintw(LINES / 2, (COLS - strlen(titleDied)) / 2, "%s", titleDied);
        attroff(COLOR_PAIR(1));
        refresh();
        usleep(1000000);
    }
    return flag; // Все клетки мертвы
}

void gameLoop(int grid[MAX_Y][MAX_X])
{
    int speed = 1000000;
    int equalGrid = 0;
    while (1)
    {
        displayGrid(grid);
        equalGrid = updateGrid(grid);

        usleep(speed); // Задержка для скорости игры

        int ch = getch(); // Ожидание нажатия клавиши
        if ((isGridDead(grid) == 1) || (ch == 'q') || (equalGrid == 1))
        {
            break; // Завершение по клавише 'q'
        }
        else
        {
            setSpeed(ch, &speed);
        }
    }
    return;
}

void copyGrid(int grid[MAX_Y][MAX_X], int newGrid[MAX_Y][MAX_X])
{
    for (int y = 0; y < MAX_Y; y++)
    {
        for (int x = 0; x < MAX_X; x++)
        {
            grid[y][x] = newGrid[y][x];
        }
    }
    return;
}

void setSpeed(char numKey, int *speed)
{
    switch (numKey)
    {
    case '1':
        *speed = 1000000;
        break;
    case '2':
        *speed = 500000;
        break;
    case '3':
        *speed = 300000;
        break;
    case '4':
        *speed = 150000;
        break;
    case '5':
        *speed = 100000;
        break;
    case '6':
        *speed = 90000;
        break;
    case '7':
        *speed = 80000;
        break;
    case '8':
        *speed = 70000;
        break;
    case '9':
        *speed = 50000;
        break;
    default:
        break;
    }
}
